import React from "react";
import "./Result.css";
import Button from "../auxiliaries/button";
import { Switch, Route, withRouter, Link } from "react-router-dom";

class Result extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    const between = (x, min, max) => {
      return x >= min && x <= max;
    };

    if (
      this.props.currentTime >=
        this.props.targetTime - 0.1 * this.props.targetTime &&
      this.props.currentTime <=
        this.props.targetTime + 0.1 * this.props.targetTime
    ) {
      return (
        <>
          <p>You made the perfect turkey. Everyone loved it!</p>
          <h1>Cooking streak: 7</h1>
          <Link to="/splash1">
            <Button message="Continue streak!" />
          </Link>
        </>
      );
    } else {
      return (
        <p>
          You undercooked the turkey and everyone got ill.{" "}
          {this.props.currentTime}
        </p>
      );
    }
  }
}

export default Result;
